class WebSite{
    #location;

    constructor(){
        this.#location = [{city: 'Москва', coordinates: [55.75, 37.57]}, 
                            {city: 'Санкт-Петербург', coordinates: [59.57, 30.19]}, 
                            {city: 'Екатеринбург', coordinates: [56.50, 60.35]}];
    }

    setUserLocation(){
        const city = localStorage.getItem('city');

        if(city != null && this.#location.some(obj => obj.city == city)){
            this.#location.sort(function(a, b){
                if(a.city == city){
                    return -1;
                }else if(b.city == city){
                    return 1;
                }else{
                    return 0;
                } 
            });
        }
    }

    get currentCoordinates(){
        return this.#location[0].coordinates;
    }
    
    get currentCoordinates(){
        return this.#location[0].coordinates;
    }
}

const webSite = new WebSite();

export default webSite;
